import React from "react";

const ToDoLists = (props) => {
  return (
    <>
      <div className="todo_style">
        <i className="list_style fas fa-times-circle" 
            onClick={() => {
                props.onSelect(props.id);
            }}

        />
        
        <li> {props.text} </li>
      </div>
    </>
  );
};

export default ToDoLists;
